import React from "react";
import {BrowserRouter, Route, Switch} from "react-router-dom";
import Register from "./pages/Register";

export default function App() {
  return <BrowserRouter>
    <Switch>
      <Route path="/register" element={<Register />} />
    </Switch>
  </BrowserRouter>
}
